import React from 'react';
import './index.css';

let count;

const click = () => {
    return (
        <>
            {count + 1}
            {console.log(count)}
        </>
    );
}

function App() {
    return (
        <>
        <div className='ab'>
            <h1>0</h1>
            <button type="button" onClick={click}>Click Me</button>
            </div>
        </>
    );
}

export default App;
